    false,nt"url": null,nt"notes": "This data layer is a point coverage of
    known sediment samplings, inspections and probings from the usSEABED data collection
    and integrated using the software system dbSEABED. This data layer represents the
    calculated (CLC) output of the dbSEABED mining software. It contains results from
    calculating variables using empirical functions working on the results of extraction
    or parsing. The CLC data is the most derivative and certainly the least accurate;
    however, many clients appreciate that it extends the coverage of map areas with
    attributes, especially physical properties attributes.",nt"owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",nt"extras":
